Sobre os cidadãos não serem oprimidos, aí acho que é um erro imenso

@Marcelv_3 @Pati_Medeiross @erikakokay @TinaMontesanti Estou falando antes do ocorrido. O MP não faz perícia. Não venha com essa...
Tá. Enquanto Bolsonaro não for o culpado, mesmo sem razão, vocês não se convencem.
Então, a pergunta não é "Quem matou Marielle?", mas: "Como faremos pra Bolsonaro ser culpado por matar Marielle?"

